window.bookSummaryJSON = "<p>We join Montana, recently returned from an impromptu study abroad trip, a bit wiser, a bit broader in perspective, and a lot freaked out by the once-dead person who's currently in his bedroom.</p> <p>Possible zombie sightings aside, he's finally ready to take his job as Duke seriously. And just in time too - not only are the politics of the capital rapidly closing in on Montana's little valley holding, but there are also goblins to negotiate with. Plus, that cult threatening to take the lives of his citizens.&nbsp;</p> <p>Montana will have to pull off the impossible - walk amongst the highest levels of Vuldranni society to influence world politics, and slaughter a few goblins in the process.</p>"; 
